@samwightt 2019: First production usage. Found significant flaws in the model. API is being redesigned. Deep server support is being added.

2020: Fixed flaws in the model which caused 80% of bugs. Found right boundaries between APIs.

2021: Fixed adoption strategy. Working with community.

@Stefano32748896 The two concurrent features we've already described are:

1. startTransition, which lets you keep your app responsive even during large screen updates (https://t.co/ZMXRvhGoxL)
2. Selective Hydration, which lets server-rendered React apps boot way faster (https://t.co/neN5GVvWVb)

@alex_permiakov @rickhanlonii For example:

startTransition(() =&gt; {
  props.onClick(); // may set state in parent
})

or

startTransition(() =&gt; {
  dispatch(action); // for useReducer+context above
})

and you can use isPending to track progress where the action happened (next to the button!)
